import React from 'react'
import Navbar from '../Navbar'
import { dataArr } from '../../PopularCourses/PopularCourses'
import './Courses.css'
const Courses = () => {
  return (
    <div>
      <Navbar />
      {
        <div className='mainCDiv row'>
          <div className="col-4">
            {dataArr.map((item) => (
              <div className="cardC">
                <img src={item.cImg} className='courseImg' alt="" />
                <hr /><p className="Ctitle">{item.cName}</p>
                <hr /><input type="button" className='mybtn' value="Click" />
              </div>
            ))}
          </div>
          <div className="col-6 t"></div>
        </div>
      }

    </div>
  )
}

export default Courses
